identification:
  title: A Study Relation Between Soil And Cantilever Sheet Pile. A Model Of Theory
    And Designing
  abstract: This study the theories and modelling methods of relation between the
    soil and embedded cantilever sheet pile structure. The backfill material that
    constitutes the earth retained by the pile wall plays an important role in determining
    the behavior of these structures. . One typically Rankine or coulomb earth stress
    theories to expect the earth pressure exerted by soil on the sheet pile wall.
    Additionally, the look at considers the contribution of numerous soil parameters
    within the interaction and the volume of reaction in phrases of conduct, deformation,
    and stress distribution. It is found that the true behavior and magnitude of deformation
    and stress distribution is generally depends upon the modelling and designing
    techniques.
